import React from "react";
import { useParams } from "react-router-dom";

const AssetDetails = () => {
  const { trackingId } = useParams(); // Get tracking ID from URL

  return (
    <div>
      <h2>Asset Details</h2>
      <p>Tracking ID: {trackingId}</p>
    </div>
  );
};

export default AssetDetails;
